43:24 Na ka kawe taua tangata i aua tangata ki te whare o Hohepa, ka hoatu e ia he wai hei horoi mo o ratou waewae; i hoatu ano e ia he kai ma a ratou kaihe. 43:25 Na ka taka e ratou te hakari mo te taenga mai o Hohepa i te awatea: i rongo hoki ratou me kai taro ratou ki reira. 43:26 ¶ A, i te taenga mai o Hohepa ki te whare, ka kawea e ratou ki a ia te hakari a o ratou ringa ki te whare, a ka piko ki a ia ki te whenua. 43:27 Na ka ui ia ki a ratou ki te pai, ka mea, Kei te pai ranei to koutou p
