 e taku tama. 43:30 Na ka hohoro a Hohepa; he tokonga ake hoki no tona ngakau aroha ki tona teina: a ka rapua e ia tetahi wahi hei tangihanga; a haere ano ia ki te ruma i roto, ki reira tangi ai. 43:31 Na ka horoia e ia tona mata, ka puta ki waho, ka whakamanawanui, ka mea, Whakatakotoria he taro. 43:32 Na ka whakatakotoria e ratou, mana ki a ia anake, ma ratou ki a ratou anake, ma nga Ihipiana, i kai tahi me ia, ki a ratou anake: e kore hoki e ahei i nga Ihipiana te kai taro tahi me nga Hiperu;
